import React from 'react';

function Shipping() {
    return (
        <div>
            <h2>Shipping Information</h2>
            <p>Orders are shipped within 3-5 business days.</p>
            <p>Free shipping for orders over $100!</p>
        </div>
    );
}

export default Shipping;
